{c_important}Kanalisiert{/c} Ihr eine Fertigkeit, bildet sich unter Euch eine Blutpfütze. Kanalisiert Ihr eine Fertigkeit in einer Pfütze, verursachen Eure {c_important}kanalisierten{/c} Fertigkeiten {c_random}[SF_13|1] %{/c}{c_gray}[x]{/c} erhöhten Schaden, und Ihr erhaltet {c_number}[SF_12|1] %{/c} Schadensreduktion.

Es kann sich nur alle {c_number}[SF_11|0]{/c} Sek. eine Pfütze bilden.

{icon:bullet}Schaden: {c_random}[SF_14|1] %{/c} {icon:arrow} {c_random}[SF_15|1] %{/c} {icon:arrow} {c_random}[SF_16|1] %{/c}
